Lexer_result lexer(char* data, char* filename) {
	Lexer_result result = {
		.tokens_count = 0,
		.tokens = malloc(0)
	};

	Token* tokens = malloc(0);
	unsigned int tokens_count = 0;

	char* string = calloc(1,1);
	int state = 1;

	int line = 1;
	int column = 1;

	for (int i = 0; i < strlen(data);) {
		char c = data[i];

		if (c == '\n') {
			line++;
			column = 1;
		} else
			column++;

		int nstate = rules[state - 1][c];

		if (nstate == -1)
			nstate = rules[state - 1][256];

		if (nstate == -1) {
			ERROR("Lexer rules error\n");
			exit(1);
		}

		if (nstate == 0) {
			tokens = realloc(tokens, sizeof(Token) * (++tokens_count));
			tokens[tokens_count-1].type = rules[state - 1][257];
			tokens[tokens_count-1].value = string;
			tokens[tokens_count-1].filename = filename;
			tokens[tokens_count-1].line = line;
			tokens[tokens_count-1].column = column;
			string = calloc(1,1);
			state = 1;
			continue;
		}

		int len = strlen(string);
		string = realloc(string, len + 2);
		string[len] = c;
		string[len + 1] = 0;

		i++;
		state = nstate;
	}

	for (int i = 0; i < tokens_count; i++) {
		if (tokens[i].type == NEWLINE || tokens[i].type == SPACE || tokens[i].type == TAB) {
			continue;
		}

		// if (tokens[i].type == BACK_SLASH && tokens[i + 1].type == NEWLINE) {
		// 	i++;
		// 	continue;
		// }

		result.tokens = realloc(result.tokens, sizeof(Token) * (++result.tokens_count));
		result.tokens[result.tokens_count - 1] = tokens[i];
	}

	return result;
}
